import React from 'react';
import s from './Dialogs.module.css'
import {Message} from "./Message/Message";
import {DialogItem} from "./DialogItem/DialogItem";

type DialogsStructureType = {
    id: number
    name: string
}
type MessagesStructureType = {
    id: number
    message: string
}
type DialogsPropsType = {
    dialogs: Array<DialogsStructureType>
    messages: Array<MessagesStructureType>
}


export const Dialogs = (props: DialogsPropsType) => {

    let messagesElements = props.messages.map(m => <Message message={m.message}/>)

    let dialogsElements = props.dialogs.map(d => <DialogItem name={d.name} id={d.id}/>)

    return (
        <div className={s.dialogs + ' ' + s.item}>

            <div className={s.dialogItems}>
                {dialogsElements}
            </div>
            <img  src="https://i.pinimg.com/736x/bb/30/32/bb30326dda4f8240abb3ac64b4804583.jpg" alt="Avatar"/>
            <div className={s.messages}>
                {messagesElements}
            </div>
        </div>
    );
};
